// Tilda Devmode Safe Script (no eval)
(function(){
    'use strict';
    
    console.log('[Tilda Devmode] Loading page content...');
    
    // Проверяем что мы на Tilda
    const isTilda = window.location.hostname.includes('tilda') || 
                    window.location.hostname.includes('tilda.cc') ||
                    document.querySelector('.t-container, .t-records, [class*="tilda"]');
    
    if (!isTilda) {
        console.warn('[Tilda Devmode] This script works only on Tilda');
        return;
    }
    
    try {
        // Декодируем Base64 контент
        const decodeBase64 = function(base64) {
            const text = window.atob(base64);
            const length = text.length;
            const bytes = new Uint8Array(length);
            for (let i = 0; i < length; i++) {
                bytes[i] = text.charCodeAt(i);
            }
            const decoder = new TextDecoder('utf-8');
            return decoder.decode(bytes);
        };
        
        const encoded = ``;
        const decoded = decodeBase64(encoded);
        
        console.log('[Tilda Devmode] Decoded content length:', decoded.length);
        
        // Метод 1: Создаем script элемент (самый безопасный)
        const script = document.createElement('script');
        script.type = 'text/javascript';
        script.textContent = decoded;
        
        // Добавляем в документ
        const head = document.head || document.getElementsByTagName('head')[0];
        if (head) {
            head.appendChild(script);
        } else {
            document.documentElement.appendChild(script);
        }
        
        console.log('[Tilda Devmode] Script injected successfully');
        
        // Ждем загрузки Tilda
        const waitForTilda = function(callback, maxAttempts = 30) {
            let attempts = 0;
            
            const check = function() {
                attempts++;
                
                // Проверяем наличие Tilda API
                const tildaReady = window.t_onReady || 
                                  window.tilda || 
                                  document.querySelector('.t-editor');
                
                if (tildaReady || attempts >= maxAttempts) {
                    clearInterval(interval);
                    
                    if (tildaReady) {
                        console.log('[Tilda Devmode] Tilda detected, attempt:', attempts);
                        callback(true);
                    } else {
                        console.log('[Tilda Devmode] Tilda not found after', attempts, 'attempts');
                        callback(false);
                    }
                }
            };
            
            const interval = setInterval(check, 500);
            check(); // Первая проверка сразу
        };
        
        // Запускаем ожидание
        waitForTilda(function(tildaFound) {
            if (tildaFound) {
                console.log('[Tilda Devmode] ✅ Tilda is ready!');
                
                // Если есть t_onReady, вызываем
                if (typeof window.t_onReady === 'function') {
                    window.t_onReady(function() {
                        console.log('[Tilda Devmode] ✅ Page ready to save!');
                        showSuccessMessage();
                    });
                } else {
                    // Показываем сообщение через 2 секунды
                    setTimeout(showSuccessMessage, 2000);
                }
            } else {
                console.log('[Tilda Devmode] ⚠️ Tilda not detected, but content loaded');
                showInfoMessage();
            }
        });
        
        // Функция показа сообщения
        function showSuccessMessage() {
            try {
                const msg = document.createElement('div');
                msg.id = 'tilda-devmode-message';
                msg.style.cssText = `
                    position: fixed;
                    top: 20px;
                    right: 20px;
                    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
                    color: white;
                    padding: 15px 25px;
                    border-radius: 10px;
                    z-index: 1000000;
                    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
                    font-size: 14px;
                    font-weight: 500;
                    box-shadow: 0 10px 40px rgba(0,0,0,0.2);
                    border: none;
                    animation: tildaSlideIn 0.5s cubic-bezier(0.68, -0.55, 0.265, 1.55);
                    max-width: 350px;
                    backdrop-filter: blur(10px);
                `;
                
                // Добавляем CSS анимацию
                const style = document.createElement('style');
                style.textContent = `
                    @keyframes tildaSlideIn {
                        from { 
                            transform: translateX(100%) translateY(-20px); 
                            opacity: 0; 
                        }
                        to { 
                            transform: translateX(0) translateY(0); 
                            opacity: 1; 
                        }
                    }
                    @keyframes tildaPulse {
                        0% { box-shadow: 0 10px 40px rgba(102, 126, 234, 0.4); }
                        50% { box-shadow: 0 15px 50px rgba(102, 126, 234, 0.6); }
                        100% { box-shadow: 0 10px 40px rgba(102, 126, 234, 0.4); }
                    }
                    #tilda-devmode-message {
                        animation: tildaPulse 2s infinite;
                    }
                `;
                document.head.appendChild(style);
                
                msg.innerHTML = `
                    <div style="display: flex; align-items: center; gap: 12px;">
                        <div style="font-size: 24px;">✨</div>
                        <div>
                            <div style="font-weight: 600; font-size: 16px; margin-bottom: 4px;">Devmode Activated</div>
                            <div style="opacity: 0.9; font-size: 13px;">You can now save the page in Tilda editor</div>
                        </div>
                    </div>
                `;
                
                document.body.appendChild(msg);
                
                // Автоудаление через 15 секунд
                setTimeout(() => {
                    if (msg.parentNode) {
                        msg.style.opacity = '0';
                        msg.style.transform = 'translateX(100%) translateY(-20px)';
                        setTimeout(() => msg.remove(), 500);
                    }
                }, 15000);
                
                // Кнопка закрытия
                setTimeout(() => {
                    const closeBtn = document.createElement('div');
                    closeBtn.innerHTML = '×';
                    closeBtn.style.cssText = `
                        position: absolute;
                        top: 5px;
                        right: 10px;
                        cursor: pointer;
                        font-size: 20px;
                        opacity: 0.7;
                        transition: opacity 0.2s;
                    `;
                    closeBtn.onmouseover = () => closeBtn.style.opacity = '1';
                    closeBtn.onmouseout = () => closeBtn.style.opacity = '0.7';
                    closeBtn.onclick = () => msg.remove();
                    msg.appendChild(closeBtn);
                }, 100);
                
            } catch(e) {
                console.log('[Tilda Devmode] Message error:', e);
            }
        }
        
        function showInfoMessage() {
            console.log('[Tilda Devmode] Showing info message');
            // Похожее сообщение но с другим текстом
            showSuccessMessage();
            // Обновляем текст
            setTimeout(() => {
                const msg = document.getElementById('tilda-devmode-message');
                if (msg) {
                    msg.querySelector('div > div > div:nth-child(1)').textContent = 'Content Loaded';
                    msg.querySelector('div > div > div:nth-child(2)').textContent = 'Try saving the page now';
                }
            }, 100);
        }
        
    } catch(error) {
        console.error('[Tilda Devmode] Error:', error);
        
        // Fallback метод: создаем iframe
        try {
            const iframe = document.createElement('iframe');
            iframe.style.display = 'none';
            document.body.appendChild(iframe);
            
            const iframeDoc = iframe.contentDocument || iframe.contentWindow.document;
            iframeDoc.open();
            iframeDoc.write('<script>' + decoded + '<\/script>');
            iframeDoc.close();
            
            console.log('[Tilda Devmode] Used iframe fallback');
        } catch(e) {
            console.error('[Tilda Devmode] Fallback failed:', e);
        }
    }
})();